import { request, newRequest } from './request'
export function getDetail (iid) {
  return newRequest({
    url: '/detail',
    params: {
      iid
    }
  })
}
export class GoodsInfo {
  constructor() { }
}
class Person {
  constructor(name, age) {
    this.name = name
    this.age = age
  }
}
const p = new Person('whi', 12)
console.log(p)
